import React from "react";
import { useSelector } from "react-redux";

const Episodes = () => {
  const seasonsDetailed = useSelector((state) => state.series.tvSeason.data);
  return (
    <div className="grid grid-cols-4 gap-2 ">
      {seasonsDetailed.episodes?.map((item, index) => {
        return (
          <div
            key={index}
            className="flex gap-2 flex-row justify-start items-center border rounded-xl p-1"
          >
            <span className="bg-yellow-500 font-serif font-bold text-lg p-1 rounded-xl text-black">
              Episode {item.episode_number}
            </span>
            <span className="text-sm">{item.name}</span>
          </div>
        );
      })}
    </div>
  );
};

export default Episodes;
